class Light {
  // \u4FDD\u5B58\u6240\u6709\u72B6\u6001\u7684\u5F15\u7528
  constructor() {
    this.off = new Off(this)
    this.weak = new Weak(this)
    this.strong = new Strong(this)
  }

  setState(state) {
    this.state = state
  }

  // next\u63A5\u53E3\u8981\u548COff\u3001Weak\u3001Strong\u7EDF\u4E00
  next() {
    this.state.next()
  }
}

